import React from 'react';

import SideNav from '@react/react-spectrum/SideNav/js/SideNav';
import SideNavItem from '@react/react-spectrum/SideNav/js/SideNavItem';
import SideNavHeader from '@react/react-spectrum/SideNav/js/SideNavHeading';
import ButtonGroup from '@react/react-spectrum/ButtonGroup';
import Button from '@react/react-spectrum/Button';
import CheckmarkCircle from '@react/react-spectrum/Icon/CheckmarkCircle';
import Add from '@react/react-spectrum/Icon/Add';
import Delete from '@react/react-spectrum/Icon/Delete';
import Bell from '@react/react-spectrum/Icon/Bell';
import Camera from '@react/react-spectrum/Icon/Camera';
import Undo from '@react/react-spectrum/Icon/Undo';
import Remove from '@react/react-spectrum/Icon/Remove';

export default class ProtoSideNav extends React.Component {
    render(){
      return (
        <ButtonGroup
  style={{textAlign: 'left'}}
  aria-label="ButtonGroup"
  // onChange={change}
  orientation="vertical"
>
          <Button value="react" icon={<CheckmarkCircle />} />
          <Button value="add" icon={<Add />} />
          <Button value="delete" icon={<Delete />} />
          <Button value="bell" icon={<Bell />} />
          <Button value="remove" icon={<Remove />} />
          <Button value="camera" icon={<Camera />} />
          <Button value="undo" icon={<Undo />} />
        </ButtonGroup>
            // <SideNav defaultValue="test">
            //     <SideNavItem value="0" label="SideNav Item"></SideNavItem>
            //     <SideNavHeader label="sideNav Header"></SideNavHeader>
            //     <SideNavItem value="1" label="SideNav Item"></SideNavItem>
            //     <SideNavItem value="2" label="SideNav Item"></SideNavItem>
            // </SideNav>
      )
    }
  }
